import React from 'react';

/* Componet */
import About from './About';
import Service from './Service';
import Project from './Project';
import Contact from './Contact';

const Main = () => (
    <main>
        <About />        

        <Service />
        
        <Project />

        <Contact />
    </main>
);

export default Main;
